import './App.css';
import LoginSignUp from './components/Login_SignUp.jsx'
import { Route, Router } from 'react-router-dom';
import OTP_UI from './components/OTP.jsx';

function App() {
  return (
    <Routes>
      <Route path='/' element={<LoginSignUp />} />
      <Route path='/otp' element={<OTP_UI />} />
    </Routes>
  );
}

export default App;
